import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ProductListPage from './pages/ProductListPage';

const TestPage = () => {
  return (
    <div className="bg-gray-200 min-h-screen flex items-center justify-center">
      <div className="bg-white p-8 rounded shadow-md">
        <h1 className="text-3xl font-bold mb-4">Test Page</h1>
        <p className="text-lg">This is a basic HTML page with Tailwind CSS styling.</p>
        <p className="text-gray-600 mt-4">You can add more content here as needed.</p>
      </div>
    </div>
  );
};

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<ProductListPage />} />
        <Route path="/test" element={<TestPage />} /> {/* New route for test page */}
      </Routes>
    </Router>
  );
};

export default App;
